WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Ola!

WordPress ten unha característica incluída que detecta cando un plugin ou tema provoca un erro fatal no teu sitio, e avísate con este correo electrónico automatizado.
###CAUSE###
Primeiro visita a túa web (###SITEURL###) e revisa calquera problema visible. A continuación visita a páxina onde se capturou o erro (###PAGEURL###) e revisa calquera problema visible.

###SUPPORT###

Se o teu sitio se mostra roto e non podes acceder normalmente ao teu escritorio, WordPress ten un «modo de recuperación» especial. Isto permíteche acceder de maneira segura ao teu escritorio e seguir investigando.

###LINK###

Para manter a salvo o teu sitio, esta ligazón caducará en ###EXPIRES###. Non te preocupes por iso, a pesar disto enviaráseche unha nova ligazón por correo electrónico se ocorre de novo o erro despois de que caduque.

