.org/documentation/'=>'https://wordpress.org/documentation/','Patterns that contain buttons and call to actions.'=>'Padróns que conteñen botóns e chamadas á acción.','Multi-column patterns with more complex layouts.'=>'Padróns de múltiples columnas con estruturas complexas.','Patterns containing mostly text.'=>'Padróns que conteñen principalmente texto.','Display your latest posts in lists, grids or other layouts.'=>'Mostrar as túas últimas entradas en listas, cuadrículas, ou outras disposicións.','A set of high quality curated patterns.'=>'Unha selección de padróns de alta calidade.','Block pattern categoryCall to Action'=>'Chamada á acción','Sections whose purpose is to trigger a specific action.'=>'Seccións para desencadear unha acción específica.','A variety of designs to display your team members.'=>'Un conxunto de deseños para mostrar os membros do teu equipo.','Block pattern categoryTestimonials'=>'Testimonios','Share reviews and feedback about your brand/business.'=>'Comparte valoracións sobre a túa marca/negocio.','Block pattern categoryServices'=>'Servizos','Briefly describe what your business does and how you can help.'=>'Describe brevemente en que consiste o teu negocio e como podes axudar.','Block pattern categoryContact'=>'Contacto','Display your contact information.'=>'Mostra a túa información de contacto.','Introduce yourself.'=>'Preséntate.','Block pattern categoryPortfolio'=>'Carteira','Showcase your latest work.'=>'Mostra o teu traballo máis recente.','Different layouts for displaying images.'=>'Distintos deseños para mostrar imaxes.','Different layouts containing video or audio.'=>'Distintos deseños que conteñen vídeos ou audios.','A variety of footer designs displaying information and site navigation.'=>'Unha variedade de deseños de pés de páxina con información e navegación do sitio.','A variety of header designs displaying your site title and navigation.'=>'Unha variedade de deseños de cabeceiras con título do sitio e navegación.','Untitl