Banners','Block pattern categoryPosts'=>'Entradas','Block pattern categoryTeam'=>'Equipo','Block pattern categoryAbout'=>'Acerca de','Used as a fallback template for all pages when a more specific template is not defined.'=>'Usado como modelo alternativo para todas as páxinas cando non hai definido un modelo máis específico.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Mostra as entradas máis recentes, así como a páxina de inicio do sitio ou a páxina de entradas definida nos axustes de lectura. Se existe, o modelo de páxina de inicio sobrescribirá a este modelo cando se mostren as entradas en dita páxina de inicio.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Mostra a páxina de inicio do teu sitio, tanto se está configurada para amosar as últimas entradas como se é unha páxina estática. O modelo da páxina de inicio ten prioridade sobre todos os modelos.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Mostra calquera contido individual, como unha entrada ou páxina. Este modelo servirá como alternativa cando non se poida encontrar un modelo específico (por exemplo Entrada, Páxina ou Adxunto).','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Mostra unha entrada individual na túa web, a menos que se aplicara un modelo personalizado a esa entrada ou exista un modelo dedicado.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Mostra unha páxina estática, a menos que se aplicara un modelo personalizado á páxina ou exista un modelo dedicado.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Mostra calquera arquivo, incluíndo entradas por autor, categoría, etiqueta, taxonomía, tipo de contido personalizado, e data. Este modelo servirá como alternativa cando non se poidan encontrar modelos máis específicos (por exemplo categoría ou etiqueta).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Mostra un arquivo de entradas de cada autor individual. Este modelo servirá como alternativa cando non se poida encontrar un modelo máis específico (por exemplo Autor: Admin).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Mostra un arquivo de categorías de entrada. Este modelo servirá como alternativa cando non se poida encontrar un modelo máis específico (por exemplo Categoría: Receitas).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Mostra un arquivo de taxonomías personalizadas. Ao igual que as categorías e as etiquetas, as taxonomías usan termos que podes utilizar para clasificar cousas. Por exemplo: unha taxonomía chamada «Arte» pode ter múltiples termos como «Moderno» e Século XVIII». Este modelo servirá como alternativa cando non se poida encontrar un modelo máis específico (por exemplo Taxonomía: Arte).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Mostra un arquivo de entradas cando se visita unha data específica (por exemplo, example.com/2023/).','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Mostra un arquivo de etiqueta de entrada. Este modelo servirá como alternativa cando non se poida encontrar un modelo máis específico (por exemplo Etiqueta: Pizza).','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Mostra cando un visitante ve a páxina que existe dedicada a calquera medio adxunto.','Displays when a visitor performs a search on your website.'=>'Mostra cando un visitante realiza unha busca na túa web.','Displays your site\'s Privacy Policy page.'=>'Mostra a páxina de política de privacidade do teu sitio.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Mostra cando un visitante ve unha páxina que non existe, como por exemplo unha ligazón morta ou unha URL mal tecleada.','Get Involved'=>'Únete','custom backgroundBackground'=>'Fondo','custom image headerHeader'=>'Cabeceira','block categoryPatterns'=>'Padróns','template part areaGeneral'=>'Xeral','template part areaHeader'=>'Cabeceira','template part areaFooter'=>'Pé de páxina','Template nameBlog Home'=>'Inicio do blog','Template nameSingle Entries'=>'Entradas individuais','Template nameAll Archives'=>'Todos os arquivos','Template nameAuthor Archives'=>'Arquivos de autor','Template nameCategory Archives'=>'Arquivos de categorías','Template nameDate Archives'=>'Arquivos de datas','Template nameTag Archives'=>'Arquivos das etiquetas','Attachment Pages'=>'Páxinas de adxuntos','Template nameSearch Results'=>'Resultados da busca','Template namePage: 404'=>'Páxina: 404','Expand search field'=>'Ampliar o campo de busca','The menu provided is not a valid menu.'=>'O menú proporcionado non é válido.','The duotone id "%1$s" is not registered in %2$s settings'=>'O id duotono «%1$s» non está rexistrado nos axustes de %2$s